css:
.items {
    top: 100px;
    position: absolute;
    left: 0;
    width: 45%;
    background-color: #27574a !important;
}

.details {
    right: 0;
    position: absolute;
    width: 55%;
    min-height: 100%;
    background-color: #378771 !important;
}

.button-itens-profile {
    background-color: #17382f !important;
    transition: 0.5s;
    width: 140px;
    height: 100%;
    border-radius: 35px;
    border: none;
    color: white;
    font-family: 'Roboto', sans-serif;
    font-weight: 700;
}

.button {
    background-color: #0b1b17 !important;
    transition: 0.5s;
    width: 200px;
    height: 100%;
    border-radius: 35px;
    border: 1px solid #0b1b17 !important;
    color: white;
    font-family: 'Roboto', sans-serif;
    font-weight: 700;
}

body {
    background-color: #0b1b17 !important;
    font-family: 'Roboto', sans-serif;
}

.badge  {
color: #198754 !important ;
}

a  {
color: #17382f !important ;
}

*{ margin:0; padding:0; box-sizing: border-box; }
body { background-color: #fff9e6; font-family: 'Roboto', sans-serif; }
.navbar { height: 310px; color: white; font-family: 'Roboto', sans-serif; font-weight: 500; font-size: 13pt;}
.brightness{ top:0; left:0; right: 0; height: 310px; position: absolute; z-index: 1; background-color: rgba(0,0,0,0.4); }
.background-img-header{ top:0; left:0; right: 0; width:100%; height: 310px; position: absolute; z-index: 0; object-fit:cover; }

.container-box-profile-itens { margin-top: 10px; margin-left: auto; /* width: 320px; */ width: 150px; height: 60px;border: 1px solid #e8e8e8; box-shadow: 0 2px 3px rgb(0 0 0 / 20%); background-color: white; padding: 5px; border-radius: 35px;}
.bt-meus-pedidos-fechar{ background-color: gray !important; }
.no-peds{ font-size:16px; }
.resdadospedido span { display: block; font-size: 1.4em; color: #555; letter-spacing: 1px; }
.histpedido { display: inline-block; width: 100%; padding: 3px; margin: 5px 0; border-top: 1px solid #d6d6d6; border-bottom: 1px solid #d6d6d6; font-size: 10px; }
h3.tit-cont.titlefinalizacompra.notitle { font-size: 26px; margin-bottom: 15px; }
h3.tit-cont.titlefinalizacompra {color: #182f7b; text-transform: uppercase; font-weight: 700; font-size: 22px; float: none; }
h3.tit-cont, h3.tit-home, .aba_sessao, span.box_combo_nome, a.linkbairros, p.tit_modalmont, h3.tit_itemmont, li.tituloopc, span.titulo_nomesabor, span.inbtncomprar, #txttotal, .nome-prod, .preco-prod, h2.nome_combo, a.abacombo, span.nomesaborlistasabores, #montador_combo .item_simp_comb p, p.descricao_combo, .btnfinaliza_combo, .btnVoltar_combo, .btnAvancar_combo, a.btn_sel_item, span.lista_nomeprincipal, li.cidadeatend, p.nomeitem_resumo, p.tit_combo_resumo, .menu ul li a { font-family: oswald,sans-serif!important; text-transform: uppercase!important;}
h3.tit-cont { color: #a40000; font-size: 32px; float: left; padding-top: 24px; }
.codspedido { margin-left: 1%; float: left; width: 15%; }
.resdadospedido { display: inline-block; width: 45%; }
.pedhistsit { display: block; font-size: 1.4em; color: #555; margin-right: 5px; text-align: right; }
@media (max-width: 768px){
.resdadospedido { display: inline-block; width: 73% !important; }
.codspedido { margin-left: 1%; float: left; width: 25% !important; }
.histpedido a{ display:block } 
.pedhistsit{ margin-top:10px; } 
}
.cont-botoes-act-ped{ display: flex; width: 100%; justify-content: flex-end; }
.bt-meus-pedidos-meus-dados{ height:30px !important; margin-right:20px; }
.bt-meus-pedidos-fechar{ height:30px !important; }
.container-pedidos-in{ height: -webkit-fill-available; }
#cardapio-sabores{ overflow:auto; height: 100%; }
.text-loja-fechada{ color:white; }
.checkout a { color: #ffffff !important;}
.button-itens-profile { background-color: #005d8d; transition: 0.5s;width: 140px; height: 100%; border-radius: 35px; border: none;color: white; font-family: 'Roboto', sans-serif;font-weight: 700;}
.lightbox-pedidos { transition:0.7s; bottom:0; right:0; left:0; height:0; position:fixed; background-color:white; border-radius:10px 10px 0 0; z-index:99999999; padding:30px; }
.lightbox-pedidos .title-info { margin-bottom:20px; width: 100%; font-weight:500; padding:10px; background-color:#dfdfdf; color:#006292; }
.modal-content { border: 0px !important; border-radius: 0px !important; }
.justify-content-end { margin-bottom: 130px !important; }}
.navbar-brand {opacity: 0 !important;}

.container-navbar { height: 180px; z-index: 2; }
.container-navbar i { font-size: 25pt; margin-right: 20px; }
.container-search { margin-top: 10px; width: 100%; height: 60px; border:1px solid #e8e8e8; box-shadow: 0 2px 3px rgba(0,0,0,0.2); background-color: white; padding: 5px; border-radius: 35px; }
.input-text { margin-left: 20px; width: 96%; height:100%; border:1px solid transparent; outline:none; border-radius: 35px; }
.button { background-color: #019119; transition: 0.5s; width: 200px; height:100%; border-radius: 35px; border: 1px solid #019119; color: white; font-family: 'Roboto', sans-serif; font-weight: 700; }
.button:hover { filter: brightness(80%); }
.button2 { background-color: #016191; transition: 0.5s; padding: 15px 30px; border-radius: 35px; border: 1px solid #016191; color: white; font-family: 'Roboto', sans-serif; font-weight: 700; }
.button2:hover { background-color: #016191; color: white; }

.navbar-scroll {background-color:white; display:none; transition:0.7s; box-shadow: 0 2px 3px rgba(0,0,0,0.2);}
.container-search-scroll { width: 100%; height: 50px; border:1px solid #e8e8e8; background-color: white; padding: 5px; border-radius: 3px; }
.input-text-scroll { margin-left: 5px; width: 96%; height:100%; border:1px solid transparent; outline:none; border-radius: 3px; }
.button-scroll {background-color: #016191; transition: 0.5s; width: 30px; height:100%; border-radius: 3px; border: 1px solid #016191; color: white; font-family: 'Roboto', sans-serif; font-size:11pt; }
.button-scroll:hover { filter: brightness(80%); }

.container-products {margin-top: 80px; background-color: white; border: 1px solid #e8e8e8; padding: 30px; border-radius: 4px;}
.categories a{color: #17382f; text-decoration: none; transition: 0.5s;}
.categories a:hover{color: #016191;}

.title {font-family: 'Roboto', sans-serif; font-weight:700; text-transform: uppercase; color: #555555; height: 48px; }
.subtitle1 { font-family: 'Roboto', sans-serif; font-size:11pt; font-weight:700; color: #266939; }
.subtitle2 { font-family: 'Roboto', sans-serif; font-size:11pt; font-weight:700; color: #106996; }
.button3 { margin:15px 0 25px 0; width: 100%; padding: 7px 0; background-color:#17382f; border: transparent; color: white; border-radius:3px; transition: 0.5s; font-size:11pt; }
.button3:hover { filter: brightness(80%); }

.cart {z-index:3; top:50%; right:0; position:fixed; width:75px; height:75px; margin-top:-37.5px; font-size:25pt; border-radius:10px 0 0 10px; background-color:#17382f; color:white; box-shadow: 0 2px 3px rgba(0,0,0,0.7); cursor:pointer;}
.badge {position: absolute; top:0; left:0; margin-top:-10px; margin-left:-10px; border-radius:50%; color: white; background-color: white; font-size: 12pt;}

.swal2-styled.swal2-confirm { border: 0; border-radius: .25em; background: initial; background-color: #198754 !important; color: #fff; font-size: 1em; }
.modal-backdrop { z-index: 1 !important; }

.menu-mobile { z-index:999999999; bottom:20px; right:0; left:0; margin:0 auto; position:fixed; width: 300px; max-width:100%; display:flex; justify-content:between; background-color: #006292; border-radius:5px; }
.menu-mobile .item {  padding: 10px; text-align:center; color: white; font-size: 11pt; }

.checkout {z-index:999; position:fixed; top:0; right:0; bottom:0; width:0; overflow-y:auto; }
.details { right:0; position:absolute; width:55%; min-height:100%; background-color: #198754;}
.details h4 {font-family: 'Roboto', sans-serif; color:white; margin-bottom:20px;}
.details label {font-family: 'Roboto', sans-serif; color:white;}
.cx {width:100%; padding:8px; border-radius:5px; background-color:white; border:transparent; margin-bottom: 25px;}
.retirada {background-color: #156842; border-radius:5px;}
.details h5 {font-family: 'Roboto', sans-serif; color:white; margin-bottom:15px;}
.button4 {width: 300px; max-width:100%; padding: 7px 0; border-radius:30px; background-color:#27574a; border: transparent; color: white; box-shadow: 0px 2px 3px rgba(0,0,0,0.5); transition: 0.5s; font-size:11pt; }
.button4:hover { filter: brightness(80%); }
.items {top:100px; position:absolute; left:0; width:45%; background-color:#156842;}
.items h5 {font-family: 'Roboto', sans-serif; color:white; margin-bottom:15px;}
.items h3 {font-family: 'Roboto', sans-serif; color:white; margin-bottom:15px;}
.img-items {margin-right:10px; width:50px; height:50px; border-radius:30px; object-fit:cover;}
.items span {margin-left:10px; font-family: 'Roboto', sans-serif; color:white;}
.back { padding:10px; background-color:white; color:#046393; text-align:center; }

.lightbox-categorias { transition:0.7s; bottom:0; right:0; left:0; height:0; position:fixed; background-color:white; border-radius:10px 10px 0 0; z-index:99999999; padding:30px; }
.lightbox-categorias .title-categorias { margin-bottom:20px; width: 100%; font-weight:500; padding:10px; background-color:#dfdfdf; color:#006292; }

.lightbox-info { transition:0.7s; bottom:0; right:0; left:0; height:0; position:fixed; background-color:white; border-radius:10px 10px 0 0; z-index:99999999; padding:30px; }
.lightbox-info .title-info { margin-bottom:20px; width: 100%; font-weight:500; padding:10px; background-color:#dfdfdf; color:#006292; }

.modal-header {border-bottom: 1px solid transparent;}
.img-modal { max-width:100%; margin-bottom:30px; }
.quant{border:2px solid #198754; border-radius:35px; padding:2px;}
#input-qtd { border:transparent;  width: 50px; outline:none; text-align:center;}
.plus{padding:2px 8px; font-size: 13pt; font-weight:700; color:#198754; cursor:pointer;}
.minus{padding:2px 8px; font-size: 13pt; font-weight:700; color:#198754; cursor:pointer;}

@media (max-width: 768px){.desktop{display:none;} .input-text { width: 87%;} .button{width: 130px;} .navbar {height: 210px;} .brightness{height: 210px;} .container-search { margin-top: -35px; height: 50px;} #products{margin: 0 10px;} .container-products {margin-top: 40px;} .details{width:100%; min-height:800px;} .items {position:static; width:100%;} #img-modal { height:200px; } .subtitle1 { font-size:10pt; } .subtitle2 { font-size:10pt; } .button3 { font-size:10pt; } .background-img-header{height:210px;} }
@media (min-width: 768px){.mobile{display:none;}}
